import styled from "@emotion/styled";

const Container = styled.div`
  height: 30rem;
  width: 100%;
  padding: 3rem;
  margin-bottom: 2rem;
`;

type Props = {
  title: String;
};

export const ProductSection = (props: Props) => {
  const { title = "ฝ้าเพดานหินอ่อน" } = props;
  return (
    <Container>
      <h2>{title}</h2>
    </Container>
  );
};
